import React from "react";
import Search from "./Search";
import { Container, Row, Col } from "react-bootstrap";
const Home = () => {
    return(
        <>
            <header className="">
                <Search/>
                <h1>What are your favorite cuisines?</h1>
                <p>personalize your experience</p>
            </header>
        </>
    )
}
export default Home;
